pub fn invntt(r: &mut[i16])
{
  let mut j;
  let mut k = 127usize;
  let mut len = 2;
  let (mut t, mut zeta);
  const F: i16 = 1441; // mont^2/128
  while len <= 128 {
    let mut start = 0;
    while start < 256 {
      zeta = ZETAS[k];
      k -= 1;
      j = start;
      while j < (start + len) {
        t = r[j];
        r[j] = barrett_reduce(t + r[j + len]);
        r[j + len] = r[j + len] -t;
        r[j + len] = fqmul(zeta, r[j + len]);
        j += 1
      }
      start = j + len;
    }
    len <<= 1;
  }
  for j in 0..256 {
    r[j] = fqmul(r[j], F);
  }
}

// Name:        basemul
//
// Description: Multiplication of polynomials in Zq[X]/((X^2-zeta))
//              used for multiplication of elements in Rq in NTT domain
//
// Arguments:   - i16 r[2]: the output polynomial
//              - const i16 a[2]: the first factor
//              - const i16 b[2]: the second factor
//              - i16 zeta: integer defining the reduction polynomial
pub fn basemul(r: &mut[i16], a: &[i16], b: &[i16], zeta: i16)
{
  r[0]  = fqmul(a[1], b[1]);
  r[0]  = fqmul(r[0], zeta);
  r[0] += fqmul(a[0], b[0]);

  r[1]  = fqmul(a[0], b[1]);
  r[1] += fqmul(a[1], b[0]);
}

