fn fmr(a: i32) -> i16 {
  let a1 = (a & 65535) >> 4;
  ((a & 65535)*169
      - 3329*(a1 - ((a1 >> 4)*3 + ((a1 - ((a1>>4)<<4))>>2)))
      + (a >> 16)) as i16
}

pub fn basemul_m(r: &mut[i16], a: &[i16], b: &[i16], zeta: i16)
{
  let ab: i32 = a[1]as i32 *b[0] as i32 + a[0]as i32 *b[1] as i32;
  let a1b1z: i32 = a[1]as i32 *b[1] as i32;

  let now = Instant::now();
  fmr(a1b1z);
  let elapsed = now.elapsed().as_nanos();
  println!("FMR: {}", elapsed);
  let now2 = Instant::now();
  montgomery_reduce(a1b1z);
  let elapsed2 = now2.elapsed().as_nanos();
  println!("Montgomery: {}\n\n", elapsed2);

  r[0] = fmr(fmr(a[1]as i32 *b[1] as i32) as i32 * zeta as i32 + a[0] as i32 * b[0] as i32);
  r[1] = fmr(a[1]as i32 *b[0] as i32 + a[0]as i32 *b[1] as i32);
}

